import React from 'react';

import './Resume.css';
import Square from '../../components/Square/Square';
import Button from '../../components/Button/Button';

const Resume = () => (
  <div className='cv__resume'>
    <Square className='cv__resume-square' height={18} width={18} color={{ r: 133, g: 29, b: 252 }} />
    <h1 className='cv__resume-heading'>Resume</h1>
    <div className='cv__resume-header'>
      <h2>Education</h2>
      <Button name='DOWNLOAD CV'/>
    </div>
    <div className='cv__resume-skills_section'>
      <ul className='cv__resume-skills_section-list'>
        <li>JAVA</li>
        <li>C++</li>
        <li>Python</li>
        <li>MongoDB</li>
        <li>M</li>
        <li>JAVA</li>
      </ul>
    </div>
  </div>
);

export default Resume;
